function Itinerary() {
  return (
    <div style={{ textAlign: "center", padding: "40px" }}>
      <h2>Your Itinerary</h2>
      <p>Day 1: City Tour</p>
      <p>Day 2: Local Attractions</p>
    </div>
  );
}

export default Itinerary;
